import { Row } from "./Row";
import { data } from "../todos";
import { useState } from "react";

type Todo = {
  id: string;
  task: string;
  isCompleted: boolean;
};

export const Todos = () => {
  const [todos, setTodos] = useState<Todo[]>(data);
  return (
    <section>
      {data.map((todo) => (
        <Row key={todo.id} todo={todo} />
      ))}
    </section>
  );
};
